import React, {useState, useEffect }from "react";
import { Helmet } from 'react-helmet';

import { Title, Wrapper } from './home.style'

const Home = () => {
    const [cocktail, setCocktail] = useState([]);
    const [loading, setLoading] = useState("")

    useEffect(async () => {
        const response = await fetch("http://localhost:5000/api/v1/data");
        const data = await response.json();
        const [item] = data.cocktails;
        setCocktail(item);
        setLoading(false);
    },[]);

    return (
        <div className="App">
            <Helmet>
                <style>{'body {background-color: orange; }'}</style>
            </Helmet>
            <Wrapper>
                <Title>
                    Cocktail of the Day                
                </Title>
            </Wrapper>
            {cocktail && <div>{cocktail.Cocktail}</div>}
        </div>

    )

}

export default Home;
